import React from 'react';
import Link from 'next/link';

const linkStyle = {
    marginRight: 15
}

const Navigation = props => (
    <Link href={props.page}>
        <a style={linkStyle}>{props.title}</a>
    </Link>
)

class Header extends React.Component {
    // constructor(props) {
